$script = <<<JS

	// обработчик события window resize
	$(window).on('resize', function(){
		var newWidth = $('.gallery-container').width();

		// определяем новую высоту, coeff = 87/ 1046 означает  оптимальную высоту 87px
		// при ширине контейнера 1046px
		var newHeight = Math.trunc(87 / 1046 * newWidth);

		$('.gallery-container').each(function() {
			$(this).find('.gallery-container-item .gallery-item').each(function() {
				var newWidth = Math.trunc($(this).attr('data-ratio') * newHeight);
				$(this).attr('style', 'height:' + newHeight + 'px; width:' + newWidth + 'px;'); 
			});
		});
	});

	// вызываем обработчик window resize каждый раз при загрузке
	$(window).resize();
JS;

$this->registerJs($script);

